import React, { PureComponent } from 'react';

class Navbar extends PureComponent {
    render() {
        return (
            <div className="">
                <h1><a href="./"><img src="../logo.png" alt="로고"/></a></h1>
                <div>
                    <input type="text"/>
                    <button><img src="../search.png" alt="검색이미지"/></button>
                </div>
            </div>
        );
    }
}

export default Navbar;
